import React from 'react';
import Text from "../../../helpers/Text";
import ImageAndName from "./ImageAndName";

function Comment(props) {
    const style ={
        margin:"3%",
        border:"1px solid #EAE9F2",
        borderRadius:"8px",
        padding:"2%",
    }
    return (
        <div style={style}>
            <Text
                text="Those medals there for bungling at which you wear on your moth-eaten chest should be there for bungling at which you are best."/>
            <div style={{marginBottom: "10%"}}/>
            <ImageAndName/>
        </div>
    );
}

export default Comment;
